description:
Let's take a journey to the past to one of the darkest period of human history, but with a tiny twist. Enjoy this naughty little fantasy about a rebel woman who stood out against the terrorizing soldiers and took the lead into her beautiful hands... by the cock. Misha will show us a tiny slice of this alternative history, where sexuality takes the control instead of fear.


